INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (1, "", 8, 36, 91002, 0, 0, 100, 0, "", 40000);
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (1, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 8, 37, 91002, 107501, 0, 150, 1, "ぺコリーヌ", 40001);
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (2, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 8, 38, 91002, 107601, 0, 150, 1, "コッコロ", 40001);
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (3, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 8, 39, 91002, 107801, 0, 150, 1, "キャル", 40001);
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (4, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 8, 40, 91002, 107701, 0, 150, 1, "スズメ", 40001);
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (5, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 8, 41, 91002, 107901, 0, 150, 1, "タマキ", 40001);
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (6, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 8, 42, 91002, 107501, 0, 150, 2, "ぺコリーヌ", 40001);
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (7, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 8, 43, 91002, 107601, 0, 150, 2, "コッコロ", 40001);
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (8, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 8, 44, 91002, 107801, 0, 150, 2, "キャル", 40001);
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (9, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 8, 45, 91002, 107701, 0, 150, 2, "スズメ", 40001);
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (10, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 8, 46, 91002, 107901, 0, 150, 2, "タマキ", 40001);
