INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 2, 321, 24001, 125801, 0, 1, 1, "リリ", 40011);
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (2, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 322, 24001, 126001, 0, 1, 1, "クリア", 40011);
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (3, "んーと。\nこれ、あげる。\nはい", 2, 323, 24001, 126101, 0, 1, 1, "プレシア", 40011);
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (4, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 324, 24001, 125801, 0, 1, 2, "リリ", 40011);
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (5, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 325, 24001, 126001, 0, 1, 2, "クリア", 40011);
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (6, "お兄。\nきてくれて、うれしい", 2, 326, 24001, 126101, 0, 1, 2, "プレシア", 40011);
